import React, { Component } from 'react';

class HomeRightVideoHeighLights extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            videoHeighLights: [],
        };
    }

    componentDidMount() {

        fetch("https://back.cricwick.net/api/v1/user_api/home_videos?telco=mobilink")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoaded: true,
                        videoHeighLights: result
                    });
                },

                // Handling Erro
                (error) => {
                    this.setState({
                        isLoaded: true,
                        error
                    });
                }
            )
    }

    render() {
        const { videoHeighLights, error, isLoaded } = this.state;
        console.log(videoHeighLights);

        if (error) {
            return (<div> Error : {error.message}</div>);
        } else if (!isLoaded) {
            return (<div> Loading Data.... </div>);
        } else {

            return (
                <div className="card">
                    <h5 className="card-title">VIDEO HIGHLIGHTS</h5>
                    {videoHeighLights.timeline_videos.map((video, i) => (
                        <div key={video.id} className="card-body">
                            <img src={video.thumb} alr=""/>
                            {video.title}
                        </div>
                    ))}
                </div>
            );
        }
    }
}


export default HomeRightVideoHeighLights;
